import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';

import NavBar from './navBar/navBar';
import Channels from './channels/channels';
import About from './about/about';
import Twitter from './channels/twitter/twitter';
import Instagram from './channels/instagram/instagram';

function App() {
  return (
    <Router>
      <div className="App">
        <NavBar />
        <Switch >
          <Route path='/' exact component={Channels}></Route>
          <Route path='/about' component={About}></Route>
          <Route path='/channels' exact component={Channels}></Route>
          <Route path='/channels/instagram' component={Instagram}></Route>
          <Route path='/channels/twitter' component={Twitter}></Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
